    "aerial-image-over-quivira-national-wildlife-refuge-acquired-on-november-11th-1978",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is a georeferenced version
    of an original black and white aerial photograph obtained from Earth Explorer (USGS)
    on November 11, 1978.  The original photo was georeferenced against Stafford County
    NAIP (2012) imagery.This image represents the refuge landscape approximately 20
    years after the establishment of Quivira National Wildlife Refuge. This image allows
    a great look back in time to interpret habitat types and land use patterns.  These
    changes and others (extent of woody vegetation) can be made from this image using
    current imagery for comparison. This image, and others, are being used by refuge
    staff to assist in understanding and visualizing the historical content of the lands
    within the refuge and how they have changed over the last 80 years. Pixel resolution
    of this image is 5.72 meters. This image should be used for resource-level interpretation
    only.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
